  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains well chemistry observations
  compiled by the Utah Geological Survey, and published as a Web feature service for
  the National Geothermal Data System.  Fields in the Aqueous Chemistry Content Model
  will become XML elements in interchange documents for WMS simple features provided
  by a node in the USGIN network. Each feature includes an Analysis Name, Sampling
  feature name, file access instructions and Source. The dataset is spatially referenced
  to EPSG: 4326 (for interoperability). The data contained in the submitted dataset
  is available as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to
  Aqueous Chemistry  Content Model: http://stategeothermaldata.org/data_delivery/content_models/aqueous_chemistry.\",\n\t\"license_title\":
